    marginLeft: 8,
    width: "100%",
    color: "#153b8e",
    flex: 1
  },
  search: {
    marginLeft: "20px",
    marginTop: "10px",
    width: "100%",
    flex: 1,
    borderRadius: "0% 0% 0 0",
    backgrounColor: "#ffffff",
    boxShadow: "none"
  }
};

class Auth extends Component {
  constructor(props) {
    super(props);
    this.state = {
      authEvent: props.authEvent,
      username: "",
      password: ""
    };
  }

  handleSubmit() {
    const { authEvent, username, passsword } = this.state;
    authEvent(username, password);
